  \"2013-03-14T19:50:31.643072\",\n\t\"name\": \"digtial-elevation-model-dem-250k\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Digital Elevation Model (DEM) is the terminology
  adopted by the USGS to describe terrain elevation data sets in a digital raster
  form. The standard DEM consists of a regular array of elevations cast on a designated
  coordinate projection system. The DEM data are stored as a series of profiles in
  which the spacing of the elevations along and between each profile is in regular
  whole number intervals. The normal orientation of data is by columns and rows. Each
  column contains a series of elevations ordered from south to north with the order
  of the columns from west to east. The DEM is formatted as one ASCII header record
  (A-record), followed by a series of profile records (B-records) each of which include
  a short B-record header followed by a series of ASCII integer elevations per each
  profile. The last physical record of the DEM is an accuracy record (C-record). 1-degree
  DEM (3- by 3-arc second data spacing). Provides coverage in 1- by 1-degree blocks.
  Two products (three in some regions of Alaska) provide the same coverage as a standard
  USGS 1- by 2-degree quadrangle. The basic elevation model is produced by or for
  the Defense Mapping Agency (DMA), but is distributed by the USGS in the DEM data
  record format. Coverage is for the United States.\",\n\t\"license_title\": null,\n\t\"extras\":
